import { registerIcon } from "@ui5/webcomponents-base/dist/asset-registries/Icons.js";

const name = "hint";
const pathData = "M256 1c141 0 256 115 256 256S397 512 256 512C116 512 1 398 1 257S116 1 256 1zm0 460c113 0 205-92 205-204S369 53 256 53C144 53 52 145 52 257s92 204 204 204zm0-345c22 0 39 18 39 39s-17 38-39 38c-21 0-38-17-38-38s17-39 38-39zm0 128c16 0 26 10 26 26v102c0 15-10 26-26 26-15 0-25-11-25-26V270c0-16 10-26 25-26z";
const ltr = true;
const collection = "SAP-icons-v5";
const packageName = "@ui5/webcomponents-icons";

registerIcon(name, { pathData, ltr, collection, packageName });

export default { pathData };
